import React from "react";
import './Auth.css';

function Auth() {
    return (
      <div className="Auth">
        <header className="Auth-header">
            <h1>User Authentication</h1>
        </header>
        <div className="auth-box">
            <form>
                <label>
                    Username:
                    <input type="text" name="username" />
                </label>
                <label>
                    Password:
                    <input type="password" name="password" />
                </label>
                <button type="submit">Login</button>
            </form>
        </div>
      </div>  
    );
}

export default Auth;
